CREATE SCHEMA IF NOT EXISTS rgs;
DROP TABLE IF EXISTS rgs.items CASCADE;
CREATE TABLE rgs.items (
    id bigserial PRIMARY KEY,
    omschrijving text,
    parent_id text,
    parent_code text,
    niveau text,
    referentiecode text,
    referentieomslagcode text,
    sortering text,
    referentienummer double precision,
    omschrijving_verkort text,
    d_c text,
    nivo double precision,
    basis text,
    uitgebr text,
    ez_vof text,
    zzp text,
    woco text,
    inactief text,
    bb double precision,
    agro text,
    wkr double precision,
    ez_vof_1 text,
    bv text,
    woco_1 double precision,
    bank double precision,
    ozw_coop_sticht_fwo double precision,
    afrek_syst double precision,
    nivo5 text,
    uitbr5 text,
    stichting text,
    ozw double precision,
    fwo text,
    coop text
);
CREATE INDEX IF NOT EXISTS idx_items_code ON rgs.items (None);
CREATE INDEX IF NOT EXISTS idx_items_parent_id ON rgs.items (parent_id);
